import { useSelector } from 'react-redux'

export const Check = ({ productId }) => {
    const cart = useSelector(state => state.cart.cart)

    const response = cart.filter((product) => product.id === productId)

    if (response) {
        console.log(response)
        return true
    }
    return false
}
